import React, { useContext } from "react";
import "./Cart.css";
import { StoreContext } from "../../components/context/StoreContext";

const Cart = () => {
  const { cartItems, food_list } = useContext(StoreContext);

  return (
    <div className="cart">
      <div className="cart-items">
        <div className="cart-items-title">
          <p>Items</p>
          <p>Title</p>
          <p>Price</p>
          <p>Quantity</p>
          <p>Total</p>
          <p>Remove</p>
        </div>
        <br />
        <hr />
        {Object.keys(cartItems).map(itemId => {
          const item = food_list.find(item => item.id === itemId);
          if (item) {
            return (
              <div className="cart-items-title cart-items-items" key={item.id}>
                <img src={item.image} alt="" />
                <p>{item.name}</p>
                <p>{item.price}</p>
                <p>{cartItems[itemId]}</p>
                <p>{item.price * cartItems[itemId]}</p>
                <p>x</p>
              </div>
            );
          } else {
            return null; // If item is not found in food_list, do not render
          }
        })}
      </div>
    </div>
  );
};

export default Cart;
